#### Important Principles

1. **Encapsulation**
   - Hiding internal state and requiring all interaction to be performed through an object's methods.

2. **Inheritance**
   - Creating new classes that reuse, extend, and modify the behavior defined in other classes.

3. **Polymorphism**
   - The ability of an object to take on many forms. Most commonly used in method overriding and interface implementation.

4. **Abstraction**
   - Hiding the implementation details and showing only the functionality to the user.

#### Key Equations and Code Snippets

1. **Method Overriding**
   ```java
   class Animal {
       void sound() {
           System.out.println("Animal makes a sound");
       }
   }

   class Dog extends Animal {
       @Override
       void sound() {
           System.out.println("Dog barks");
       }
   }
   ```

2. **Interface Implementation**
   ```java
   interface Vehicle {
       void start();
       void stop();
   }

   class Car implements Vehicle {
       public void start() {
           System.out.println("Car started");
       }

       public void stop() {
           System.out.println("Car stopped");
       }
   }
   ```

3. **Constructor Chaining**
   ```java
   class Parent {
       Parent() {
           System.out.println("Parent constructor");
       }
   }

   class Child extends Parent {
       Child() {
           super(); // Calls Parent constructor
           System.out.println("Child constructor");
       }
   }
   ```

4. **Default Methods in Interfaces**
   ```java
   interface Flyable {
       default void fly() {
           System.out.println("Flying");
       }
   }

   class Bird implements Flyable {
       // No need to override fly() if default implementation is sufficient
   }
   ```

5. **Activation Records and Stack Management**
   - Understanding how function calls are managed in the stack, including pushing and popping activation records.

6. **Polymorphism and Dynamic Method Dispatch**
   ```java
   class Animal {
       void sound() {
           System.out.println("Animal makes a sound");
       }
   }

   class Dog extends Animal {
       @Override
       void sound() {
           System.out.println("Dog barks");
       }
   }

   public class Main {
       public static void main(String[] args) {
           Animal myAnimal = new Dog(); // Polymorphism
           myAnimal.sound(); // Calls Dog's sound method
       }
   }
   ```

7. **Object Class Methods**
   ```java
   class Person {
       private String name;
       private int age;

       @Override
       public String toString() {
           return "Person{name='" + name + "', age=" + age + "}";
       }

       @Override
       public boolean equals(Object obj) {
           if (this == obj) return true;
           if (obj == null || getClass() != obj.getClass()) return false;
           Person person = (Person) obj;
           return age == person.age && name.equals(person.name);
       }

       @Override
       public int hashCode() {
           return Objects.hash(name, age);
       }
   }
   ```

8. **Inner Classes**
   ```java
   class OuterClass {
       private int outerField;

       class InnerClass {
           void display() {
               System.out.println("Outer field: " + outerField);
           }
       }
   }
   ```

